import React from "react";
import styled from "styled-components";

// import K from "../assets/title/K.png";

const StyledHeader = styled.div`
  .header {
    font-family: "Montserrat";
    display: flex;
    justify-content: space-between;
    margin: 20px;
    font-size: 200%;
    text-align: center;
  }
  p {
    padding: 15px;
    font-weight: 500;
    font-size: 24px;
    line-height: 142.6%;
    /* or 34px */
    display: flex;

    color: #ff6060;
  }
  .left-header {
    p {
      font-size: 100%;
    }
  }
  .right-header {
    display: flex;
    width: 550px;
    justify-content: space-between;
    p {
      width: 50%;
    }
  }
`;

export default function Header() {
  return (
    <StyledHeader>
      <div className="header">
        <div className="left-header">
          <p>KASA</p>
        </div>
        <div className="right-header">
          <p>Accueil</p>
